import React from "react";
import {
    Container,
    Row,
    Col,
    Button,
    Modal,
    ListGroup,
    Spinner,
  } from "react-bootstrap";
import "./MainPage.css";
import Select from "react-select";

var options = [{ label: "1 queen", value: 1 }];

export default class MainPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            board: []
        }
    }
    render() {
        return (
            <div className='web-container'>
                <div className='mainpart'>
                    <Spinner 
                    animation="border" 
                    role="status"
                    style={{display: 'none'}}>
                        <span className="sr-only">Loading...</span>
                    </Spinner>
                    <div className='sizeDecide'>
                        <div id='selection'>
                            <Select
                                className='selection'
                                onChange={(e) => {
                                console.log(e);
                                this.selectQueen(e);
                                }}
                                label="Select Queens"
                                options={options}
                            />
                        </div>
                        <div id='texts'>
                            <p>Backtracking Search for -queeen problem</p>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
